  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Niobrara
  National Wildlife Refuge outlines Refuge accomplishments from February through April
  of 1939. The report begins by summarizing the weather conditions. Wildlife- including
  migratory birds, big game animals, furbearers, predators, rodents, and raptors-
  is also covered. The Refuge development and maintenance section discusses physical
  developments and plantings. The public relations section of the report describes
  recreational uses and Refuge visitors. Resource management is outlined; topics include
  grazing. Photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
